import React, { Component } from 'react';
import './App.css';
import { BrowserRouter } from "react-router-dom";
import Login from './Main/Login';

class App extends Component {
  render() {
    return (
      <div className="App">
      <BrowserRouter>
          <Route path="/tacos" component={Tacos} />
      </BrowserRouter>
        <Route path="/login" component={Login} />
      </div>
    );
  }
}

export default App;
